import React from 'react';
import { Link } from 'react-router-dom';
import "./Inicio.css"; 

const Inicio = () => {
  return (
    <div className="Tela">
    <div className="menu-lateral">
      <h1 className="sidebar-title">Mind Break</h1>
      <Link to="/Inicio" className="menu-button">Consultas</Link>
      <Link to="/tela2" className="menu-button">Formul√°rios</Link>
      <Link to="/tela3" className="menu-button">Financeiro</Link>
      <Link to="/tela4" className="menu-button">Pacientes</Link>
    </div>
    <h1 className="sidebar-title">Bom dia</h1>
      <Link to="/Inicio" className="menu-button">Login</Link>
    </div>
  );
};

export default Inicio;
